$.fn.overview = function(){

	this.each(function(){

		var $block = $(this),
		    $sections = $block.find('.overview__item'),
		    duration = 750;


		// $block.height(window.innerHeight);
		var setSize = function(){
			$block.height(window.innerHeight);
		};
		$window.on('resize', setSize);
		setSize();


		$block.find('.overview__item__icon').each(function(){
			// blocks and vars
			var $icon = $(this),
			    $inner = $icon.find('.overview__item__icon__inner'),
			    time = 280,
			    animated = false,
			    easing = 'easeOutCubic';
			// {event} hover on link
			$icon.on(site.device.support.touch ? 'click' : 'mouseenter', function(){
				if (animated) return;
				animated = true;
				$inner.velocity({ rotateZ:0 }, 0);
				$inner.velocity({ rotateZ:-180 }, time, easing, function(){
					animated = false;
				});
			});
		});

		$sections.each(function(index){

			// blocks and vars
			var $section = $(this),
			    $picture = $section.find('.overview__item__picture'),
			    $overlay = $('<i class="overview__item__overlay" />').appendTo($section),
			    $image = $picture.find('img'),
			    $icons = $section.find('.overview__item__icon'),
			    image = $image.attr('src'),
			    name = $section.data('name'),
			    isLast = index >= $sections.length-1;

			// image
			$('<img />')[0].src = image;
			$picture.css('background-image', 'url(' + image + ')');

			var styles = {
				overlay: {
					visible: { opacity: 0 },
					hidden: { opacity: 0.3 }
				},
				section: {
					visible: { translateY:'0%', scale:1 },
					prev: { translateY:'-22%', scale:0.94 },
					next: { translateY:'100%', scale:1 }
				}
			};

			// {event} show project
			$section.on('show', function(event, options){
				var time = options.force ? 0 : duration;
				window.location.hash = name;
				$block.addClass('overview_' + name);
				setTimeout(function(){
					$section.addClass('overview__item_active');
				}, 10);
				if (options.direction.prev) {
					$overlay.velocity(styles.overlay.visible, 0);
					$overlay.hide();
				} else {
					$overlay.show().velocity(styles.overlay.visible, duration, 'easeOutCubic', function(){
						$overlay.hide();
					});
				}
				$overlay.velocity(styles.overlay.visible, time, 'easeOutCubic');
				$section
					.show()
					.velocity(styles.section[options.direction], 0)
					.velocity(styles.section.visible, time, 'easeOutCubic');
				if (!site.device.isPhone) $icons.each(function(){
					$(this).velocity('stop');
					if (options.direction=='next') {
						$(this).velocity({ translateY: (20 + Math.random()*20) }, 0);
					}
					$(this).velocity({
						translateY: 0
					}, {
						duration: time*0.75 + 0.5 * time * Math.random(),
						easing: 'easeOutCubic',
						delay: time*0.2
					});
				});
			});

			// {event} hide project
			$section.on('hide', function(event, options){
				var time = options.force ? 0 : duration;
				$block.removeClass('overview_' + name);
				$overlay
					.show()
					.velocity(styles.overlay.visible, 0)
				if (options.direction=='prev') {
					$overlay.velocity(styles.overlay.hidden, time, 'easeOutCubic');
				}
				$section
					.show()
					.velocity(styles.section.visible, 0)
					.velocity(styles.section[options.direction], time, 'easeOutCubic', function(){
						if (!isLast || options.direction!='prev') {
							$section.removeClass('overview__item_active');
							$section.hide();
						}
						if (options.direction=='next') $section.hide();
					});
				if (!site.device.isPhone) $icons.each(function(){
					var offset = (options.direction=='prev' ? -1 : 1) * (20 + Math.random()*20);
					$(this).velocity('stop').velocity({
						translateY: offset
					}, {
						duration: time + 0.5 * time * Math.random(),
						easing: 'easeOutCubic'
					});
				});
			});

		});

		$sections.hide();

		// custom scroller
		$block.frame({
			sections: '.overview__item, .subscribe',
			duration: duration,
			delay: duration*1.25
		});

	});

};
$.fn.panel = function(){

	this.each(function(){

		var $block = $(this),
		    $title = $block.find('.panel__title'),
		    $content = $block.find('.panel__content'),
		    $list = $content.find('.panel__content__list'),
		    $close = $block.find('.panel__close'),
		    $items = $([]),
		    $overlay = $('<div class="panel__overlay" />').insertBefore($block)
		    updateURL = $block.data('url'),
		    source = $block.find('.panel__template').html(),
		    template = Handlebars.compile(source),
		    request = null,
		    duration = 350,
		    itemWidth = 360,
		    itemHeight = 240,
		    ratio = itemWidth/itemHeight,
		    currentName = false,
		    itemMaxHeight = 290;

		// fix ipad glitch
		$block.velocity({ translateX:'0%' }, 0);

		// scroll
		var scroll = new IScroll($content[0], {
			disableMouse: true,
			mouseWheel: true,
			scrollX: false,
			scrollY: true,
			click: false,
			tap: false,
			bindToWrapper: false,
			scrollbars: 'custom',
			interactiveScrollbars: !site.device.support.touch,
			probeType: 3
		});
		scroll.disable();

		var updateVisibility = function(){
			if (!currentName) return false;
			categories[currentName].items.forEach(function(item, index){
				if ((item.offset>-scroll.y - itemMaxHeight) && (item.offset < -scroll.y + site.sizes.height) && !item.visible) {
					item.visible = true;
					var $picture = item.$thumb.find('.panel__item__picture'),
					    src = $picture.data('thumb');
					$picture.append('<img src="'+src+'" />');
				}
			});
		};

		var showCategory = function(name, callback, filledCallback){
			if (name==currentName || !categories[name]) {
				if (typeof callback == 'function') filledCallback($block.find('.panel__item'));
			} else {
				currentName = categories[name].name;
				$list.empty();
				$title.empty();
				$title.text( categories[name].title );
				$list.html( template(categories[name]) );
				$items = $block.find('.panel__item');
				categories[name].items.forEach(function(item, index){
					item.visible = false;
					item.$thumb = $items.eq(index);
				});
				if (typeof callback == 'function') callback($items);
				if ($root.hasClass('page_panel')) resize();
			}
		};

		var updateOffsets = function(){
			if (!currentName) return false;
			var items = categories[currentName].items;
			items.forEach(function(item){
				item.offset = item.$thumb.position().top;
			});
		};

		var open = function(callback){
			if ($root.hasClass('page_panel')) return false;
			$root.addClass('page_panel');
			scroll.enable();
			$document.on('touchmove.menu mousewheel.menu', function(e){
				e.preventDefault();
			});
			$block.show().velocity({ translateX:'100%' }, duration, 'easeOutCubic');
			resize();
			$overlay.add($close).velocity('fadeIn', duration);
			if (typeof callback == 'function') callback(scroll);
		};

		var close = function(callback){
			$root.removeClass('page_panel');
			$document.off('touchmove.menu mousewheel.menu');
			scroll.disable();
			$block.velocity({ translateX:'0%' }, duration, 'easeOutCubic', function(){
				$block.hide();
				if (typeof callback == 'function') callback();
			});
			$overlay.add($close).velocity('fadeOut', duration);
		};
		var resize = function(){
			if ($items.length && $items.first().width() != itemWidth) {
				$items.find('.panel__item__picture').height( Math.floor($items.first().width()/ratio) );
			} else {
				$items.find('.panel__item__picture').height('auto');
			}
			scroll.refresh();
			updateOffsets();
			updateVisibility();
		};

		$window.on('resize', resize);
		resize();

		$block.data('panel', {
			open: open,
			close: close,
			showCategory: showCategory,
			updateVisibility: updateVisibility
		});

		$content.on('mousedown', function(e) {
			e.preventDefault();
		});

		scroll.on('scroll', updateVisibility);

		$close.add($overlay).on('click', close);

	});

};
// spaces helper
Handlebars.registerHelper('spaces', function(text) {
	return text.replace(/(^|\s)([a-zA-Z]{1,2}|\&)\s/g, '$1$2&nbsp;');
});

$.fn.projects = function(){

	this.each(function(){

		var $block = $(this),
		    $control = $block.find('.control'),
		    $menuLink = $block.find('.projects__menu'),
		    $menuLinkText = $menuLink.find('.projects__menu__text'),
		    controlAPI = $control.data('control'),
		    projectSource = $block.find('.projects__item-template').html(),
		    projectTemplate = Handlebars.compile(projectSource),
		    slideshowSource = $block.find('.projects__slideshow-template').html(),
		    slideshowTemplate = Handlebars.compile(slideshowSource),
		    sliderSource = $block.find('.projects__slider-template').html(),
		    sliderTemplate = Handlebars.compile(sliderSource),
		    projects = [],
		    easing = 'easeOutCubic',
		    largeTextLength = 250,
		    activeProject = false,
		    currentCatName = false,
		    galleryDelay = 350,
		    duration = 450;

		// categories
		for (name in categories) {
			categories[name].items.forEach(function(project){
				project.category = name;
				projects.push(project);
			});
		};

		// set block size
		var setSize = function(){
			$block.height(site.sizes.height);
		};
		$window.on('resize.projects', setSize);
		setSize();

		// {fn} create columns for project
		var createColumnsFor = function(project){
			// count of images
			project.imagesCount = project.images.length;
			project.oneImage = project.imagesCount===1;
			// create columns array
			project.columns = [];
			project.columnsSize = 0;
			// only one picture
			if (project.oneImage) {
				project.images[0].isFull = true;
				project.images[0].index = 0;
				project.columns.push({
					isFull: true,
					items: [ project.images[0] ],
					columnPosition: 0
				});
				// columns width
				project.columnsSize = 2;
			} else {
				// each images
				project.images.forEach(function(image, index){
					image.width = parseInt(image.width,10);
					image.height = parseInt(image.height,10);
					image.index = index;
					// image is last
					image.isLast = index >= project.imagesCount-1;
					// check if image already in column
					if (image.inColumn) return false;
					// create column
					var column = {
						isFull: false,
						items: [],
						columnPosition: project.columnsSize
					};
					// is vertical
					if (image.width < image.height) {
						image.isFull = true;
						column.items.push(image);
					// not vertical
					} else {
						// is last
						if (project.imagesCount<3) {
							image.isFull = true;
							column.isFull = true;
							project.columnsSize++;
							column.items.push(image);
						} else if (image.isLast) {
							image.isFull = true;
							column.items.push(image);
						// not last
						} else {
							image.isFull = false;
							column.items.push(image);
							// insert next image in current column
							var next = project.images[index+1];
							image.isFull = false;
							next.inColumn = true;
							column.items.push(next);
						}
					}
					// set flag
					image.inColumn = true;
					// save column in project
					project.columns.push(column);
					project.columnsSize++;
				});
			};
			// set indexes
			project.columns.forEach(function(column, index){
				column.columnIndex = index;
				column.isLast = index>=project.columns.length-1;
				column.items.forEach(function(image){
					image.columnIndex = column.columnIndex;
					image.columnPosition = column.columnPosition;
				});
			});
			// images sizes
			project.images.forEach(function(image, index){
				if (image.small==image.src) image.small = false;
				image.loaded = !image.small;
				image.defaultSrc = image.small ? image.small : image.src;
			});
		};

		// create project block
		var createBlockFor = function(project){
			project.$block = $('<section class="project" />').data('name', project.category + '/' + project.name).appendTo($block);
			// build before show
			project.$block.on('beforeShow', function(){
				buildProject(project);
				if (projects[project.index-1]) preloadImagesFor(projects[project.index-1]);
				if (projects[project.index+1]) preloadImagesFor(projects[project.index+1]);
				if (projects[project.index+2]) preloadImagesFor(projects[project.index+2]);
			});
		};

		// {fn} create markup for project
		var createMarkupFor = function(project){
			// check text layut
			project.hasLargeText = (project.text && project.text.length>largeTextLength);
			// fill project block
			$( projectTemplate(project) ).appendTo(project.$block);
			// elements
			var $images = project.$block.find('.project__gallery__item');
			project.$about = project.$block.find('.project__about');
			project.$client = project.$block.find('.project__client');
			project.$gallery = project.$block.find('.project__gallery');
			project.$galleryContent = project.$gallery.find('.project__gallery__content');
			project.$pictures = $images.find('.project__gallery__item__picture');
			// slideshow
			project.$slideshow = $( slideshowTemplate(project) ).appendTo($block);
			project.$slideshowContent = project.$slideshow.find('.projects__slideshow__content');
			project.$slideshowItems = project.$slideshowContent.find('.projects__slideshow__item');
			// slideshow
			project.$slider = $( sliderTemplate(project) ).appendTo($block);
			project.$sliderControl = project.$slider.find('.projects__slider__control');
			// images
			project.images.forEach(function(image, index){
				image.$block = $images.eq(index);
				image.$slide = project.$slideshowItems.eq(index);
			});
			// common operations
			project.$block.on('show', function(event, options){
				project.visited = true;
				window.location.hash = project.category + '/' + project.name;
				activeProject = project;
			});
		};

		// {fn} show project element
		var showElement = function($element, offset, time){
			$element
			.velocity({ opacity: 0, translateX: offset }, 0)
			.show()
			.velocity({ opacity: 1, translateX: 0 }, time, easing);
		};

		// {fn} hide project element
		var hideElement = function($element, offset, time){
			$element
			.velocity({ opacity: 0, translateX: -offset }, time, easing, function(){
				$element.hide();
			});
		};

		// {fn} show category message
		var showCategoryMessage = function(text){
			$('<div class="projects__message" />').text(text.replace('+ ', '+')).velocity({
				translateX: '-50%',
				scale: 0.9,
				opacity: 0
			}, 0).appendTo($block).velocity({
				scale: 1,
				opacity: 1
			}, 250, 'easeOutCubic').delay(250).velocity({
				scale: 1.1,
				opacity: 0
			}, 450, 'easeInCubic', function(){
				$(this).remove();
			});
		};

		// {fn} bind effects for project
		var createEffectsFor = function(project){
			// {event} show project
			project.$block.on('show', function(event, options){
				// new category?
				if (project.category!=currentCatName ) {
					currentCatName = project.category;
					// set text in menu link
					$menuLinkText.html('All ' + categories[project.category].title);
					// show message
					showCategoryMessage(categories[project.category].title);
					// !!! preload images in category
					// if (!categories[project.category].visited) {
					// 	categories[project.category].items.forEach(function(item){
					// 		item.images.forEach(function(image){
					// 			if (image.columnIndex<2) {
					// 				$('<img />')[0].src = image.small || image.src;
					// 			}
					// 		})
					// 	});
					// };
					// flag
					// categories[project.category].visited = true;
				}
				project.interactive = false;
				// time of animation
				var time = options.force ? 0 : duration;
				// elements
				showElement(project.$about, 40, time*0.78);
				showElement(project.$client, 20, time*0.78);
				// gallery
				if (options.direction=='next') {
					if (site.device.isPhone) {
						project.$slider.velocity('stop').velocity('fadeIn', time, easing, function(){
							project.interactive = true;
							sliderController.enable(project);
						});
					} else {
						project.$pictures.velocity('stop').height('0vh').velocity({ height: '50vh' }, time, easing, function(){
							project.interactive = true;
						});
					}
				} else {
					if (site.device.isPhone) {
						project.$slider.velocity('stop').css('opacity', 1).show();
						sliderController.enable(project);
					} else {
						project.$pictures.velocity('stop').height('50vh');
					}
					project.interactive = true;
				}
				if (project.hideTimer) clearTimeout(project.hideTimer);
				if (!site.device.isPhone) project.$gallery.show();
			});
			// {event} hide project
			project.$block.on('hide', function(event, options){
				project.interactive = false;
				sliderController.disable(project);
				// elements
				hideElement(project.$about, 40, duration*0.78);
				hideElement(project.$client, 20, duration*0.78);
				// gallery
				if (options.direction=='next') {
					if (site.device.isPhone) {
						project.$slider.velocity('stop').velocity('fadeOut', duration, easing);
					} else {
						project.$pictures.velocity('stop').velocity({ height: '0vh' }, duration, easing, function(){
							project.$gallery.hide();
						});
					}
				} else {
					if (project.hideTimer) clearTimeout(project.hideTimer);
					project.hideTimer = setTimeout(function(){
						project.$gallery.hide();
					}, duration+50);
				}
			});
		};

		// gallery controller
		var galleryController = {
			slide: function(project, index, force){
				if (!project.galleryEnabled) return false;
				this.delay(project);
				project.galleryIndex = index;
				var transform = 'translateX(' + (-0.25*index) + '%)';

				if (force) project.$gallery.addClass('project__gallery_force');
				project.$galleryContent.css({ '-webkit-transform': transform, 'transform': transform });
				setTimeout(function(){
					if (force) project.$gallery.removeClass('project__gallery_force');
				},10)
				updateController();
			},
			next: function(project){
				var index = (project.columnsSize-project.galleryIndex <= 2) ? 0 : project.galleryIndex+1;
				this.slide(project, index);
			},
			prev: function(project){
				var index = project.galleryIndex ? project.galleryIndex-1 : project.columnsSize-2;
				this.slide(project, index);
			},
			delay: function(project){
				project.galleryEnabled = false;
				setTimeout(function(){
					project.galleryEnabled = true;
				}, galleryDelay);
			}
		};

		// control controller
		var updateController = function(){
			if ((activeProject.slideshowOpened && activeProject.imagesCount<2) || (!activeProject.slideshowOpened && activeProject.columnsSize<3)) {
				controlAPI.disableState();
			} else if ((activeProject.slideshowOpened && activeProject.slideshowIndex>=activeProject.imagesCount-1) || (!activeProject.slideshowOpened && activeProject.columnsSize-activeProject.galleryIndex<=2)) {
				controlAPI.restartState();
			} else {
				controlAPI.enableState();
			}
		};


		// {fn} bind effects for project
		var createGalleryFor = function(project){
			project.galleryIndex = 0;
			project.galleryEnabled = true;
			project.$block.on('show', function(){
				updateController();
			});
		};

		// {fn} text controller
		var textController = {
			resize: function(project){
				project.$textContent.css('top', project.$about.height() + parseInt(project.$about.css('top'),10) );
				project.textScroll.refresh();
			},
			show: function(project){
				project.textOpened = true;
				project.$block.addClass('project_text');
				$block.data('frame').disable();
				project.textScroll.enable();
				project.$openLink.text('Close Info');
			},
			hide: function(project){
				project.textOpened = false;
				project.$block.removeClass('project_text');
				$block.data('frame').enable();
				project.textScroll.disable();
				project.$openLink.text('Show More Info');
			}
		};

		// {fn} bind effects for project
		var createLargeTextFor = function(project){
			project.textOpened = false;
			// blocks
			project.$openLink = project.$about.find('.project__about__open');
			project.$text = project.$block.find('.project__text');
			project.$textContent = project.$text.find('.project__text__content');
			project.$textOverlay = $('<i class="project__text-overlay" />').insertAfter(project.$text);
			// attach iscroll
			project.textScroll = new IScroll(project.$textContent[0], {
				disableMouse: false,
				mouseWheel: true,
				scrollX: false,
				scrollY: true,
				click: false,
				tap: false,
				scrollbars: 'custom',
				interactiveScrollbars: false
			});
			// scroll
			project.textScroll.disable();
			// resize
			textController.resize(project);
			$window.on('resize load', function(){
				textController.resize(project);
			});
			// {event} click on open/close
			project.$openLink.on('click', function(){
				project.textOpened ? textController.hide(project) : textController.show(project);
			});
			// {event} click on overlay
			project.$textOverlay.on('click', function(){
				textController.hide(project);
			});
		};

		// attach panel
		// $panel.data('panel').set(projects, function($items){
		// 	projects.items.forEach(function(project, index){
		// 		project.$thumb = $items.eq(index);
		// 	});
		// });

		// {fn} bind effects for project
		var createSlideshowFor = function(project){
			// variables
			project.slideshowIndex = 0;
			project.slideshowOpened = false;
			project.slideshowEnabled = true;
			// events
			project.images.forEach(function(image, index){
				image.$block.on('click', function(){
					if (project.interactive) slideshowController.show(project, image);
				});
				image.$slide.on('click', function(){
					slideshowController.hide(project, image);
				});
			});
		};

		var sliderController = {
			create: function(project){
				if (project.oneImage) return false;
				project.slider = new Sly(project.$slider, {
					horizontal: true,
					easing: easing,
					itemNav: 'forceCentered',
					smart: true,
					activateMiddle: true,
					mouseDragging: true,
					touchDragging: true,
					releaseSwing: true,
					scrollBy: 0,
					speed: 350,
					elasticBounds: true
				});
				project.slider.init();
				project.$sliderControl.on('click', function(){
					if (project.slider.rel.activeItem >= project.imagesCount-1 ) {
						project.slider.activate(0);
					} else {
						project.slider.next();
					}
				});
				var $images = project.$slider.find('.projects__slider__item').on('click', function(){
					sliderController.expand(project);
				});
				var $images = project.$slider.find('.projects__slider__close').on('click', function(){
					sliderController.collapse(project);
				});
			},
			enable: function(project){
				if (project.oneImage) return false;
				if (!project.slider) this.create(project);
				project.slider.reload();
				$window.on('resize.slider', function(){
					project.slider.reload();
				});
			},
			disable: function(project){
				if (project.oneImage) return false;
				if (!project.slider) this.create(project);
				project.slider.reload();
				$window.off('resize.slider');
			},
			expand: function(project){
				project.$slider.addClass('projects__slider_expanded');
				$root.addClass('page_allow-rotate');
			},
			collapse: function(project){
				project.$slider.removeClass('projects__slider_expanded');
				$root.removeClass('page_allow-rotate');
			}
		};

		// {fn} bind effects for project
		var slideshowController = {
			slide: function(project, index, force){
				if (!project.slideshowEnabled) return false;
				this.delay(project);
				project.slideshowIndex = index;
				var transform = 'translateX(' + (-0.5*index) + '%)';
				if (force) project.$slideshow.addClass('project__slideshow_force');
				project.$slideshowContent.css({ '-webkit-transform': transform, 'transform': transform });
				setTimeout(function(){
					if (force) project.$slideshow.removeClass('project__slideshow_force');
				}, 10)
				updateController();
				var image = project.images[index];
				if (!image.loaded) {
					$('<img />').attr('src', image.src).one('load', function() {
						image.$slide.css('background-image', 'url(' + image.src + ')');
					}).each(function() {
						if (this.complete) $(this).load();
					});
					image.loaded = true;
				}
			},
			next: function(project){
				var index = (project.slideshowIndex>=project.imagesCount-1) ? 0 : project.slideshowIndex+1;
				this.slide(project, index);
			},
			prev: function(project){
				var index = project.slideshowIndex ? project.slideshowIndex-1 : project.imagesCount-1;
				this.slide(project, index);
			},
			show: function(project, image){
				$block.data('frame').disable();
				if (image) this.slide(project, image.index, true);
				popupController.open(project, image, function(){
					project.$slideshow.show();
				});
				project.slideshowOpened = true;
				updateController();
			},
			hide: function(project, image){
				project.slideshowOpened = false;
				var index = image.columnPosition;
				if (index-project.galleryIndex===1) {
					index = project.galleryIndex;
				} else if (!project.columns[image.columnIndex].isFull && project.columns[image.columnIndex].isLast){
					index = index-1;
				};
				galleryController.slide(project, index, true);
				updateController();
				project.$slideshow.hide();
				popupController.close(project, image, function(){
					$block.data('frame').enable();
				});
			},
			delay: function(project){
				project.slideshowEnabled = false;
				setTimeout(function(){
					project.slideshowEnabled = true;
				}, galleryDelay);
			}
		};

		// popup controller
		var popupController = {
			// animation duration
			duration: duration*0.67,
			// get block layout
			getLayout: function($element){
				var offset = $element.offset();
				return { width: $element.width(), height: $element.height(), top: offset.top, left: offset.left };
			},
			// get size for cover size
			getCoverSize: function(block, image){
				var ratio = image.width/image.height;
				var result = { width: block.width, height: block.width/ratio };
				if (result.height<block.height) result = { width: block.height*ratio, height: block.height };
				return result;
			},
			// get size for contain size
			getContainSize: function(block, image){
				var ratio = image.width/image.height;
				var result = { width: block.width, height: block.width/ratio };
				if (result.height>block.height) result = { width: block.height*ratio, height: block.height };
				return result;
			},
			// get fullscren layout
			getFullscreenLayout: function(){
				return { top: '-0.5%', left: '-0.5%', width: site.sizes.width*1.01, height: site.sizes.height*1.01 };
			},
			// create popup
			create: function(image){
				var popup = {};
				popup.$block = $('<i class="projects__popup" />');
				popup.$image = $('<img />').attr('src', image.small).appendTo(popup.$block);
				popup.thumbLayout = this.getLayout(image.$block);
				return popup;
			},
			// open
			open: function(project, image, callback){
				// create block;
				var popup = this.create(image);
				// set size
				popup.$image.css(this.getCoverSize(popup.thumbLayout, image));
				// animate
				popup.$block.css(popup.thumbLayout).appendTo($block).velocity(this.getFullscreenLayout(), this.duration, easing, function(){
					popup.$block.remove();
					if (callback) callback();
				});
				popup.$image.velocity(this.getContainSize(this.getFullscreenLayout(), image), this.duration, easing);
			},
			// close
			close: function(project, image, callback){
				// create block;
				var popup = this.create(image);
				// set sizes
				popup.$block.css(this.getFullscreenLayout());
				popup.$image.css(this.getContainSize(this.getFullscreenLayout(), image));
				// animate
				popup.$block.appendTo($block)
				.velocity(popup.thumbLayout, this.duration, easing)
				.velocity({ opacity:0 }, 200, easing, function(){
					popup.$block.remove();
					if (callback) callback();
				});
				popup.$image.velocity(this.getCoverSize(popup.thumbLayout, image), this.duration, easing);
			}
		};

		// build project
		var preloadImagesFor = function(project){
			if (project.preloaded || project.visited) return false;
			project.preloaded = true;
			project.images.forEach(function(image){
				if (image.columnIndex<2) $('<img />')[0].src = image.defaultSrc;
			});
		};

		// build project
		var buildProject = function(project){
			if (project.builded) return false;
			createMarkupFor(project);
			createEffectsFor(project);
			createGalleryFor(project);
			createSlideshowFor(project);
			if (project.hasLargeText) createLargeTextFor(project);
			project.builded = true;
		};

		// init projects
		projects.forEach(function(project, index){
			project.index = index;
			project.builded = false;
			project.preloaded = false;
			createColumnsFor(project);
			createBlockFor(project);
		});


		// custom scroller
		$block.frame({
			sections: '.project',
			duration: duration
		});

		// {event} key nav
		$document.on('keydown.promo', function(e){
			if (!activeProject.textOpened) {
				if (activeProject.slideshowOpened) {
					if (e.which==37) slideshowController.prev(activeProject);
					if (e.which==39) slideshowController.next(activeProject);
				} else {
					if (e.which==37) galleryController.prev(activeProject);
					if (e.which==39) galleryController.next(activeProject);
				}
			}
		});

		// {event} click on control > next column
		$control.on('click', function(){
			if (activeProject.slideshowOpened) {
				slideshowController.next(activeProject);
			} else {
				galleryController.next(activeProject);
			}
		});

		$block.swipe('option', 'swipeRight', function(){
			if (activeProject.textOpened) return false
			if (activeProject.slideshowOpened) {
				slideshowController.prev(activeProject);
			} else {
				galleryController.prev(activeProject);
			}
		});
		$block.swipe('option', 'swipeLeft', function(){
			if (activeProject.textOpened) return false
			if (activeProject.slideshowOpened) {
				slideshowController.next(activeProject);
			} else {
				galleryController.next(activeProject);
			}
		});

		var openPanel = function($items){
			categories[activeProject.category].items.forEach(function(project, index){
				// create thumb
				var $thumb = $items.eq(index);
				$thumb.toggleClass('panel__item_active', project.index==activeProject.index);
				// {event} bind click on thumb
				$thumb.on('click', function(){
					$panel.data('panel').close(function(){
						$block.data('frame').jump(project.index);
					});
					return false;
				});
			});
		};

		// {event} click on menu link > open panel
		$menuLink.on('click', function(){
			// update panel
			$panel.data('panel').showCategory(activeProject.category, openPanel, openPanel);
			$panel.data('panel').open(function(scroll){
				scroll.scrollToElement($panel.find('.panel__item_active')[0], 0);
				setTimeout(function(){
					$panel.data('panel').updateVisibility();
				}, 50);
			});
		});

	});

};
$.fn.promo = function(){

	this.each(function(){

		var $block = $(this),
		    $content = $block.find('.promo__content'),
		    $items = $block.find('.promo__item'),
		    $next = $block.find('.promo__next'),
		    enabled = true;

		$help.appendTo($block);
		$help.data('ui-help').enable();

		if (site.device.isMobile) {

			var $bullets = $('<div class="promo__bullets" />').appendTo($block);

			$block.sly({
				horizontal: true,
				// easing: 'easeOutExpo',
				itemNav: 'forceCentered',
				smart: true,
				activateMiddle: true,
				mouseDragging: true,
				touchDragging: true,
				releaseSwing: true,
				scrollBy: 0,
				speed: 600,
				elasticBounds: true,
				pagesBar: $bullets,
				activatePageOn: 'click',
				pageBuilder:  function(index) {
					return '<i class="promo__bullets__item" />';
				}
			});

			$window.on('resize.promo', function(){
				$block.sly('reload');
			});

		} else {

			$items
				.first().addClass('promo__item_active')
				.next().addClass('promo__item_next')
				.nextUntil().addClass('promo__item_far')

			// scroll tween
			var tween = TweenMax.to($content, 1, {
				y: '6%',
				scale: 0.94,
				opacity: 0.7,
				ease: Linear.easeNone
			});

			// scroll tween
			var mouse = TweenMax.to($help, 1, {
				y: -15,
				opacity: 0,
				ease: Cubic.easeOut
			});

			// multiple scene
			var timeline = new TimelineMax();
			timeline.add([ tween, mouse ]);

			// build scene
			var scene = new ScrollScene({
				triggerElement: $block,
				triggerHook: 0,
				offset: 80,
				duration: $window.height() - 80
			});
			scene.setTween(timeline).addTo(site.scroller);

		}

		// {fn} enable next
		var enableNext = function(){
			if (!enabled) return false;
			enabled = false;
			$block
				.find('.promo__item_active')
				.removeClass('promo__item_active')
				.prev()
				.addClass('promo__item_far')
				.appendTo($content);
			$block
				.find('.promo__item_next')
				.removeClass('promo__item_next')
				.addClass('promo__item_active')
				.next()
				.addClass('promo__item_next')
				.removeClass('promo__item_far');
			setTimeout(function(){
				enabled = true;
			}, site.durations.move);
		};

		// {fn} enable prev
		var enablePrev = function(){
			if (!enabled) return false;
			enabled = false;
			var $prev = $block.find('.promo__item_active').prev();
			if (!$prev.length) $prev = $block.find('.promo__item:last').prependTo($content);
			$prev
				.removeClass('promo__item_next promo__item_far')
				.next()
				.removeClass('promo__item_active')
				.addClass('promo__item_next')
				.next()
				.removeClass('promo__item_next')
				.addClass('promo__item_far');
			setTimeout(function(){
				$prev.addClass('promo__item_active')
			}, 1)
			setTimeout(function(){
				enabled = true;
			}, site.durations.move);
			return false;
		};

		// {event} hover on next
		if (!site.device.support.touch) $next.hover(function(){
			$block.addClass('promo_next');
		}, function(){
			$block.removeClass('promo_next');
		});

		// {event} click on next
		$next.on('click', enableNext);

		// {event} key nav
		$document.on('keydown.promo', function(e){
			if (!$(e.target).is('input,textarea,select')) {
				if (e.which==37) enablePrev();
				if (e.which==39) enableNext();
			}
		});

	});

}
$.fn.rotate = function(){

	this.each(function(){

		var $block = $(this);

		var check = function(){
			if ($block.is(':visible')) {
				$document.on('touchmove.rotate mousewheel.rotate', function(e){
					e.preventDefault();
				});
			} else {
				$document.off('touchmove.rotate mousewheel.rotate');
			}
		};

		$window.on('resize.rotate', check);
		check();

	});

};
$.fn.search = function(){

	this.each(function(){

		var $form = $(this),
		    $field = $form.find('.search__input'),
		    filled = false;

		$field.on('propertychange change keyup paste input', function(){
			filled = $field.val().length>0;
			if (filled) {
				$form.addClass('search__form_filled');
			} else {
				$form.removeClass('search__form_filled');
			}
		});

		$form.on('submit', function(){
			if (!filled) return false;
		});

	});

};
$.fn.studio = function(){

	this.each(function(){

		var $block = $(this),
		    $control = $block.find('.control'),
		    $slider = $block.find('.infopage__title'),
		    $sliderItems = $block.find('.infopage__title__gallery__item'),
		    controlAPI = $control.data('control'),
		    easing = 'easeOutCubic',
		    duration = 500;

		var slider = new Sly($slider, {
			horizontal: true,
			easing: easing,
			itemNav: 'forceCentered',
			smart: true,
			activateMiddle: true,
			mouseDragging: true,
			touchDragging: true,
			releaseSwing: true,
			scrollBy: 0,
			speed: duration,
			elasticBounds: true
		});

		slider.init();

		$control.on('click', function(){
			if (slider.rel.activeItem >= $sliderItems.length-1 ) {
				slider.activate(0);
			} else {
				slider.next();
			}
		});

		controlAPI.enableState();
		slider.on('active', function(e, index){
			if (index >= $sliderItems.length-1) {
				controlAPI.restartState();
			} else {
				controlAPI.enableState();
			}
		})

		$window.on('resize.slider', function(){
			slider.reload();
		});

	});

};
$.fn.subscribe = function(){

	this.each(function(){

		var $block = $(this),
		    $form = $block.find('.subscribe__form'),
		    $field = $block.find('.subscribe__form__field'),
		    duration = 750;

		$block.find('a, input, button').attr('tabindex', -1);

		$block.on('show', function(){
			$block
			.velocity('stop')
			.velocity({ translateY:'100%' }, 0)
			.show()
			.velocity({ translateY:'0%' }, duration, 'easeOutCubic');
		});

		$block.on('hide', function(){
			$block
			.velocity('stop')
			.velocity({ translateY:'100%' }, duration, 'easeOutCubic', function(){
				$block.hide();
			});
			$field.blur();
		});

		$form.validate({
			rules: {
				email: {
					email_address: true
				}
			},
			messages: {
				email: {
					email_address: 'E-mail is invalid',
				}
			}
		});

		$form.on('submit', function(){
			var $elements = $form.find('input, textarea, button');
			if (!$form.hasClass('i-loading') && !$form.hasClass('i-success') && $form.valid()) {
				$elements.blur();
				$form.addClass('i-loading');
				$form.ajaxSubmit({
					dataType: 'json',
					success: function(result){
						$form.removeClass('i-loading');
						if (result.message=='success') {
							$elements.attr('disabled', 'disabled').attr('tabindex', '-1');
							$form.addClass('i-success');
						}
					}
				});
			};
			return false;
		});

	});

};
$.fn.uiHelp = function(){

	this.each(function(){

		var $block = $(this),
		    $hand = $block.find('.ui-help__hand'),
		    $icon = $hand.find('svg'),
		    kbClass = 'ui-help_keyboard',
		    duration = 450,
		    length = 16,
		    height = 50,
		    frame = { index:0 },
		    moveTime = 150,
		    dragTime = 700,
		    dragEasing = 'easeInOutCubic',
		    dragStyle = { translateY: -20 },
		    backStyle = { translateY: 0 },
		    interval;

		// {fn} grab
		var grab = function(){
			active = true;
			frame.index = 0;
			sequence(length-1, drag);
		};
		// {fn} ungrab
		var ungrab = function(){
			frame.index = length-1;
			sequence(0, back);
		};
		// {fn} drag
		var drag = function(){
			$hand.delay(100).velocity(dragStyle, dragTime, dragEasing, ungrab);
		};
		// {fn} back
		var back = function(){
			$hand.delay(100).velocity(backStyle, dragTime, dragEasing, grab);
		};
		// {fn} sequence
		var sequence = function(to, callback){
			TweenMax.to(frame, moveTime/1000, {
				index: to,
				roundProps: 'index',
				ease: Linear.easeNone,
				delay: 0.1,
				onUpdate: function(){
					$icon[0].style.top = (-frame.index*height) + 'px';
				},
				onComplete: function(){
					if (callback) callback();
				}
			});
		};

		var enable = function(withKeyboard){
			if (withKeyboard) interval = setInterval(function(){
				if ($block.hasClass(kbClass)) {
					$block.removeClass(kbClass);
				} else {
					$block.addClass(kbClass);
				}
			}, 5000);
			if (site.device.isMobile) grab();
		};

		var disable = function(){
			clearInterval(interval);
			$block.velocity('fadeOut', duration, 'easeOutCubic', function(){
				TweenMax.killTweensOf(frame);
				$block.remove();
			});
		};

		$block.data('ui-help', {
			enable: enable,
			disable: disable
		});

	});

};
$.fn.works = function(){

	this.each(function(){

		var $block = $(this),
		    $items = $block.find('.works__item');

		$menu.find('.menu__item_work').on('click', function(){
			var offset = $block.offset().top;
			if (site.device.support.touch) {
				$window.scrollTop(offset);
			} else {
				$('body,html').animate({ scrollTop:offset }, 350, 'easeOutCubic');
			}
			$menu.data('menu').close();
			return false;
		})

		$items.each(function(){

			var $item = $(this),
			    $picture = $item.find('.works__item__picture'),
			    duration = 1.35 + (0.25 - Math.random()/2),
			    basicColor = $item.css('background-color'),
			    hoverColor = $item.data('color');

			if (!site.device.isMobile) {
				var tween = TweenMax.fromTo($picture, duration + Math.round(Math.random()*0.2 - 0.1), {
					opacity: 0,
					y: 40 + Math.round(Math.random()*20 - 10)
				}, {
					opacity: 1,
					y: 0,
					ease: Cubic.easeOut
				});
				var scene = new ScrollScene({
					triggerElement: this,
					triggerHook: 1,
					offset: site.sizes.height/3 + Math.round(Math.random()*100 - 50) //  $item.height()/2.5
				});
				scene.setTween(tween).addTo(site.scroller);
				// hover
				$item.hover(function(){
					$item.css('background-color', hoverColor);
				}, function(){
					$item.css('background-color', basicColor);
				});
			} else {
				// hover
				$item.click(function(){
					$item.css('background-color', hoverColor);
					setTimeout(function(){
						$item.css('background-color', basicColor);
					}, 350);
				});
			}

			var timer;
			$item.on('click', function(){
				$panel.data('panel').showCategory( $(this).data('category') );
				clearTimeout(timer);
				timer = setTimeout(function(){
					$panel.data('panel').open();
				}, 75);
			});

		});

	});

};
var site = {
	scroller: new ScrollMagic(),
	sizes: {},
	durations: {
		basic: 175,
		move: 500
	},
	device: {
		support: Modernizr
	}
};


var $root = $('#root'),
    $html = $('html'),
    $body = $('body'),
    $window = $(window),
    $document = $(document),
    $menu = $root.find('.menu'),
    $panel = $root.find('.panel');
    $help = $($root.find('.ui-help__template').html());


/* --- Sizes --- */
(function(sizes){
	// {fn} update sizes
	var updateSizes = function(){
		sizes.width = $window.width();
		sizes.height = parseInt(window.innerHeight,10);
	};
	// {event} window resize
	$window.on('resize.site', updateSizes);
	// init
	updateSizes();
})(site.sizes);


/* --- Device --- */
(function(device){

	// mobile
	device.isMobile = device.support.touch;
	$html.addClass(device.isMobile ? 'd-mobile' : 'd-no-mobile');

	// phone
	var phoneCheck = function(){
		device.isPhone = (site.sizes.width<768);
		$html.addClass(device.isPhone ? 'd-phone' : 'd-no-phone');
		$html.removeClass(device.isPhone ? 'd-no-phone' : 'd-phone');
	};
	$window.on('resize.phone-check', phoneCheck);
	phoneCheck();

	// ios devices
	$html.addClass( navigator.userAgent.match(/iPad/i) ? 'd-ipad' : 'd-no-ipad');
	$html.addClass( navigator.userAgent.match(/(iPhone|iPod touch)/i) ? 'd-iphone' : 'd-no-iphone');
	$html.addClass( navigator.userAgent.match(/(iPad|iPhone|iPod touch)/i) ? 'd-ios' : 'd-no-ios');
	$html.addClass( navigator.userAgent.match(/.*CPU.*OS 7_\d/i) ? 'd-ios7' : 'd-no-ios7');

	// ios7 ipad
	if ($html.hasClass('d-ipad d-ios7')) {
		$window.on('resize orientationchange focusout', function(){
			window.scrollTo(0,0);
		});
	};

	window.viewportUnitsBuggyfill.init();

})(site.device);

